create table if not exists carts
(
    id         int unsigned auto_increment
        primary key,
    product_id int unsigned            not null,
    count      int unsigned            not null,
    open_id    varchar(200) default '' not null,
    created_at datetime                not null,
    updated_at datetime                not null,
    deleted_at datetime                null,
    order_id   int                     null
)
    charset = utf8mb3;

create table if not exists categories
(
    id         int unsigned auto_increment
        primary key,
    name       varchar(200) default '' not null,
    sequence   int                     not null,
    parent_id  int          default 0  not null,
    status     int                     not null,
    remark     varchar(1000)           null,
    created_at datetime                null,
    updated_at datetime                null,
    deleted_at datetime                null
)
    charset = utf8mb3;

create table if not exists contact
(
    id         int unsigned auto_increment
        primary key,
    name       varchar(100) default '' not null,
    phone      varchar(20)  default '' null,
    province   int                     not null,
    city       int                     not null,
    street     int                     not null,
    address    varchar(200) default '' not null,
    zipcode    varchar(50)             null,
    created_at datetime                not null,
    updated_at datetime                not null
)
    charset = utf8mb3;

create table if not exists images
(
    id            int unsigned auto_increment
        primary key,
    url           varchar(200) default '' not null,
    width         int unsigned            null,
    height        int unsigned            null,
    mime          varchar(20)  default '' not null,
    title         varchar(100) default '' not null,
    orignal_title varchar(100) default '' not null
)
    charset = utf8mb3;

create table if not exists inventories
(
    id         int unsigned auto_increment
        primary key,
    created_at datetime     not null,
    updated_at datetime     not null,
    deleted_at datetime     null,
    product_id int unsigned not null,
    count      int unsigned not null
)
    charset = utf8mb3;

create table if not exists inventory_property_value
(
    id                int unsigned auto_increment
        primary key,
    inventory_id      int unsigned not null,
    property_value_id int unsigned not null
)
    charset = utf8mb3;

create table if not exists orders
(
    id            int unsigned auto_increment
        primary key,
    user_id       int unsigned     not null,
    total_price   double           not null,
    payment       double           not null,
    freight       double default 0 null comment '运费',
    remark        text             null comment '备注',
    discount      int    default 0 null,
    deliver_start datetime         not null,
    deliver_end   datetime         not null,
    status        int              not null,
    created_at    datetime         not null,
    updated_at    datetime         not null,
    deleted_at    datetime         null,
    pay_at        datetime         not null
)
    charset = utf8mb3;

create table if not exists product_category
(
    id          int unsigned auto_increment
        primary key,
    product_id  int unsigned not null,
    category_id int unsigned not null
)
    charset = utf8mb3;

create table if not exists products
(
    id             int unsigned auto_increment
        primary key,
    name           varchar(200)  default '' not null,
    category_id    int                      not null,
    status         int           default 1  not null,
    price          double                   not null,
    detail         longtext                 not null,
    buy_count      int           default 0  null,
    total_sale     double        default 0  null,
    image_id       int unsigned             null comment '商品封面图片',
    image_ids      varchar(200)  default '' null comment '商品图片集',
    remark         varchar(1000) default '' null,
    original_price double                   null,
    created_at     datetime                 null,
    updated_at     datetime                 null,
    deleted_at     datetime                 null,
    browse_count   int           default 0  null
)
    charset = utf8mb3;

create table if not exists properties
(
    id         int unsigned auto_increment
        primary key,
    created_at datetime                not null,
    updated_at datetime                not null,
    deleted_at datetime                null,
    name       varchar(200) default '' not null,
    product_id int unsigned            not null
)
    charset = utf8mb3;

create table if not exists property_values
(
    id          int unsigned auto_increment
        primary key,
    created_at  datetime                not null,
    updated_at  datetime                not null,
    deleted_at  datetime                null,
    name        varchar(200) default '' not null,
    note        varchar(100)            null,
    product_id  int unsigned            not null,
    property_id int unsigned            not null
)
    charset = utf8mb3;

create table if not exists user_visits
(
    id              int unsigned auto_increment
        primary key,
    url             varchar(500)            null,
    referrer        varchar(500)            null,
    client_id       varchar(100) default '' not null,
    user_id         int unsigned            null,
    visit_time      datetime                not null,
    ip              varchar(100)            null,
    device_width    int unsigned            null,
    device_height   int unsigned            null,
    browser_name    varchar(200)            null,
    browser_version varchar(50)             null,
    device_model    varchar(50)             null,
    country         varchar(50)             null,
    language        varchar(50)             null,
    os_name         varchar(50)             null,
    os_version      varchar(50)             null
)
    charset = utf8mb3;

create table if not exists users
(
    id         int unsigned auto_increment
        primary key,
    name       varchar(100)           null,
    email      varchar(100)           null,
    password   varchar(100) default '' not null,
    created_at datetime               not null,
    updated_at datetime               not null
)
    charset = utf8mb3;

