INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Pickled Cucumber', 21, '[22]', 35, 2.79, '€2.79/kg');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Cherry Tomato 180g', 23, '[24]', 36, 3.19, 'Nams-Piccolo cherry tomato');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Spring Onion 100g', 25, '[26]', 37, 2.49, 'Finnish spring onion.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Red Onion 500g', 27, '[28]', 37, 0.99, 'Homegrown red onions are Finnish and packed in a mesh bag. Due to its beautiful color, red onion is well suited to salads. Marinated red onions make a tasty addition to meat dishes. Red onions are great for casseroles, pizzas and pies.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Rainbow Broccoli Packed 300 g', 29, '[30]', 38, 0.99, 'Packaged Spanish Broccoli. Beautiful green broccoli is a superfood from stem to bud. In addition to vitamins A and C, it contains minerals and protein. Broccoli is best when it''s crunchy, so scramble it raw and roast it or just lightly boil it. It is also suitable for many baked dishes. Peel and chop the stem into food as well.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Rainbow Cauliflower packed', 31, '[32]', 38, 2.38, 'Packaged Spanish Cauliflower.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Broccoli Packed Organic 300g', 33, '[34]', 38, 1.39, 'Spanish packaged organic broccoli.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Carrot 2kg', 35, '[36]', 39, 2.19, 'Finnish carrot in a 2 kg bag. The roaring carrot can be used in Christmas dishes as well - it is suitable for a carrot box');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('General potato washed', 37, '[38]', 39, 0.89, 'Washed Finnish general potato.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Domestic Colomba potato 1kg', 39, '[40]', 39, 0.99, 'A round-oval potato');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Parsnip', 41, '[42]', 39, 3.09, 'Domestic first-class parsnip. The fine aromas of parsnip are accentuated in the oven. It gives a rich spicy flavor to stews');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Jingold Kiwi Yellow', 11, '[12]', 29, 4.19, 'Italian yellow Jingold kiwi 500g box.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Strawberry 400 g', 13, '[14]', 25, 3.88, 'Spanish strawberry 400 g in a box');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Bush blueberry 500 g', 15, '[16]', 25, 6.99, 'Compared to regular blueberries');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Rainbow cantaloupe', 17, '[18]', 30, 3.69, 'Brazilian cantaloupe. €3.69/kg');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Snellman Beef sirloin steak 2 pcs 240g', 43, '[44]', 4, 10.19, 'The beef sirloin is cut and carefully cleaned of membranes by hand. After that, the steaks are pounded very thin and neatly placed in the box without folding. Steaks are easy to fry in a pan and they are prepared very quickly. Just about a minute per side and the deliciously tender steaks are ready. 100% domestic, GMO-free meat from family farms.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Snellman Beef tenderloin steak 2 pcs 320g', 45, '[46]', 4, 12.19, 'The tenderness and juiciness of beef sirloin steaks is guaranteed by mechanical tenderizing. The steaks are domestic, 100% GMO-free beef from family farms.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Snellman Beef entrecote 2 pcs 500g', 47, '[48]', 4, 17.29, 'Entrecote is juicy and tender meat. 100% Finnish, GMO-free meat from family farms.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Atria Beef Tenderloin', 49, '[50]', 4, 42.5, 'Beef tenderloin is the most valuable part of the carcass, known for its exceptional tenderness. The meat tissue is almost fat-free and has no tendons. When cut into steaks, it is suitable for a hot grill or pan for a few minutes per side, after which the perfect taste pleasure is ready. Tenderloin is used to make famous dishes such as Filet Mignon, Coer de Filet and Chateaubriand. The meat is tenderized under controlled conditions and does not contain spices. The meat is grown in Finland. €42.5/kg');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Finnish pork tenderloin nature', 51, '[52]', 8, 11.9, 'High-quality samples of craftsmanship. We only use Finnish meat. €11.9/kg');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Atria Pork Tenderloin Nature', 53, '[54]', 8, 13.99, 'Pork tenderloin in nature is the most valuable and juiciest part of the pig. The tenderloin is unseasoned and can be seasoned as desired. Unseasoned pork tenderloin can be prepared in many different ways, for example by grilling it whole or by cutting it into ready-made steaks. Works not only on the grill but also in the oven or pan. Serve with vegetables and/or salad and enjoy! €13.99/kg');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Snellman pork flank slice 350g', 55, '[56]', 8, 4.1, 'There is fat and a lot of flavor in the side of the country pig. The ready-sliced ​​side is suitable for grilling and for juicing many dishes. Rib slices are also the core of the traditional brown sauce');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Finnish pork sirloin steak 3 pieces 360g', 57, '[58]', 8, 3.85, 'Domestic pork sirloin steak. 3 pcs in the package, total weight 360 g.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Finnish Chicken strips unseasoned 300g', 59, '[60]', 26, 2.85, 'Unseasoned chicken roast strip.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Finnish unseasoned chicken fillet cut 350g', 61, '[62]', 26, 5.79, 'Unseasoned chicken fillet cut. Antibiotics have not been used as medicine during the animal''s life.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Grain Broiler Fillet Natural 320g', 63, '[64]', 26, 5.98, 'Grain broiler unseasoned whole fillet is suitable for many chicken dishes, from rich sauces to various exotic dishes. Cooled after cooking, it is also great in a salad. The antibiotic-free label on the packaging indicates that the animals have not needed a single course of antibiotics during their lives.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('L''Uomu Nokka 220g Organic broiler tenderloin', 65, '[66]', 26, 6.95, 'Tenderloin from an organic broiler');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('L''Uomu Nokka 550g Organic thigh piece', 67, '[68]', 26, 9.43, 'Thigh piece from an organic broiler. €20.96/kg');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Atria Chicken Wing Nature 800g', 69, '[70]', 26, 4.15, 'The easiest way to prepare Atria unseasoned chicken wings is in the oven. You can marinate or top season the unseasoned wings as you wish. Chopped vegetables, such as carrots, peppers, cucumbers or celery stalks, create a tasty whole with the wings. In addition, you can make your own dip for both chicken wings and vegetables to complement the already delicious world of flavors. Bring the wings to room temperature ½ hour before cooking. Spread the wings evenly on a baking sheet over baking paper and bake in a 250°C constant temperature oven for approx. 25 min, until the internal temperature is 75°C. The wings get a nice crispy surface when you place them on the baking sheet a little apart from each other. This way the wings also cook more evenly. The antibiotic-free label on the packaging indicates that the animals have not needed a single course of antibiotics during their lives.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Lerøy 400g salmon fillet piece ASC', 71, '[72]', 27, 10.9, 'A fresh and boneless piece of salmon fillet in a convenient protective gas package. Suitable for all cooking. A good choice');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Lerøy 300g generous pieces of salmon', 73, '[74]', 27, 7.65, 'Fresh and boneless pieces of salmon fillet in a convenient protective gas package. Suitable for all cooking. A great choice for soup, for example.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Finnish whitefish fillet 250g', 75, '[76]', 27, 11.9, 'Boneless whitefish fillet (may contain individual bones). Cultivated in Finland.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('SJØ Tuna fillet steak MSC 140g', 77, '[78]', 27, 8.9, 'SJØ tuna fillet is MSC certified and pre-cut into 140 gram portion pieces. Take the tuna fillet to room temperature from the refrigerator about 15 minutes before frying. Sprinkle a little salt on top of the fillet and let it season for a while. Fry the fillet piece quickly on both sides, the fillet should remain red in the middle, when it is at its juiciest. Serve with a fresh salad and enjoy! The product has been stored frozen, must not be re-frozen after thawing.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Finnish pork-beef minced meat 700 g', 79, '[80]', 28, 4.45, 'Finnish pork-beef mince, with 60% pork and 40% beef. Fat content less than 23%. Collagen/meat-protein ratio less than 18%.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Atria Better Ground Beef 400g', 81, '[82]', 28, 3.89, 'Atria''s Better Ground Beef is suitable for people who want to eat low-fat, but tasty. The low 10% fat content of ground meat is made from carefully selected pieces of beef. Low-fat meat is well suited for dishes where you want to emphasize the freshness of the spices and the healthiness of the vegetables. Try minced meat in sauces and soups, for example. An excellent use for low-fat minced meat is pizza, where a lighter meat filling is suitable next to the fatty cheese.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Minced Chicken 400g', 83, '[84]', 28, 2.99, 'Kotimaista Minced Chicken 400g');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Lamb shank 2pcs/vac.', 85, '[86]', 31, 54.95, 'New Zealand lamb shank 2pcs/vac.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Kotimaista low-fat milk 1l', 91, '[92]', 12, 0.95, 'Proteins and calcium are necessary for maintaining normal bones. Vitamin D added to milk promotes the normal utilization of calcium in the body. Milk''s riboflavin, i.e. vitamin B2 and vitamin B12, promote the normal functioning of the nervous system. In addition, vitamin B2 helps the skin, mucous membranes and vision to remain normal. Enjoy milk daily as part of a varied and balanced diet and healthy lifestyle.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Kotimaista skimmed milk 1l', 93, '[94]', 12, 0.85, 'Domestic Fat-free milk is Finnish milk. Milk is rich in calcium and vitamin D has been added to milk, which promotes the utilization of calcium in the body. Enjoy skim milk daily as part of a varied diet. Store protected from light +0 to +6 °C. Once opened, the milk can be stored in the refrigerator for 3-4 days. *The salt content is due exclusively to the sodium naturally present in milk.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Kotimaista whole milk 1l', 95, '[96]', 12, 1.19, 'Proteins and calcium are necessary for maintaining normal bones. Vitamin D added to milk promotes the normal utilization of calcium in the body. Milk''s riboflavin, i.e. vitamin B2 and vitamin B12, promote the normal functioning of the nervous system. In addition, vitamin B2 helps the skin, mucous membranes and vision to remain normal. Enjoy milk daily as part of a varied and balanced diet and healthy lifestyle.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio low-fat milk drink 1 l lactose-free', 97, '[98]', 12, 2.49, 'Valio Eila® Organic™ low-fat milk drink tastes like regular fresh milk without sweetness. The organic milk used to make the lactose-free organic milk drink comes from farms where the cows are allowed to move, eat and rest freely at their own pace in a yard barn and are in the pasture all summer. Enjoy as a food drink or use in cooking and baking! Valio Luomu™ is a sustainable choice for biodiversity. Check out other Valio Luomu™ products as well! All Valio Eila® products are suitable for a lactose-free diet.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio fat-free milk drink 1.75 l lactose-free', 99, '[100]', 12, 2.85, 'Valio Eila® lactose-free fat-free milk drink tastes like regular, fresh milk without sweetness. Valio Eila® milk drinks have been selected as the best* in the taste test. Enjoy as a food drink or use in cooking and baking! All Valio Eila® products are suitable for a lactose-free diet. Lactose has been removed using Valio''s patented technology. *Product test of lactose-free milk drinks, Makery Oy (4/2018, n=243).');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio fat-free milk drink 1 l lactose-free', 101, '[102]', 12, 2.19, 'Valio Eila® Lactose-free fat-free milk drink tastes like regular, fresh milk without sweetness. Valio Eila® milk drinks have been selected as the best* in the taste test. Enjoy as a food drink or use in cooking and baking! All Valio Eila® products are suitable for a lactose-free diet. Lactose has been removed using Valio''s patented technology. *Product test of lactose-free milk drinks, Makery Oy (4/2018, n=243).');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio 3% milk drink 1 l lactose-free', 103, '[104]', 12, 2.29, 'Valio Eila® lactose-free milk drink 3% tastes like soft, rich milk without sweetness. This slightly fatter, lactose-free milk drink is particularly suitable for cooking and baking, as well as with cocoa, coffee or tea. All Valio Eila® products are suitable for a lactose-free diet.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Kultuma organic egg M/L4 252g', 105, '[106]', 12, 2.29, 'Golden eggs are always cage-free, fresh eggs laid on Finnish family farms. Organic chickens have more room to move and the opportunity to go outside. For nutrition, they get nutritious organic feed made from grain from nearby fields. The egg is the savior of busy everyday life, with which you can conjure up everything from breakfast to dinner or dessert. It contains plenty of e.g. protein, vitamin D and vitamin B12. The golden egg can be traced back to the farm based on the code found on the egg shell. You can do this on Kultamuna''s website www.kultamuna.fi .');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Kultuma organic egg S/M6 318g', 107, '[108]', 12, 2.35, 'Golden eggs are always cage-free, fresh eggs laid on Finnish family farms. Organic chickens have more room to move and the opportunity to go outside. For nutrition, they get nutritious organic feed made from grain from nearby fields. The egg is the savior of busy everyday life, with which you can conjure up everything from breakfast to dinner or dessert. It contains plenty of e.g. protein, vitamin D and vitamin B12. The golden egg can be traced back to the farm based on the code found on the egg shell. You can do this on Kultamuna''s website www.kultamuna.fi .');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Kultuma organic egg M/L10 630g', 109, '[110]', 12, 4.25, 'Golden eggs are always cage-free, fresh eggs laid on Finnish family farms. Organic chickens have more room to move and the opportunity to go outside. For nutrition, they get nutritious organic feed made from grain from nearby fields. The egg is the savior of busy everyday life, with which you can conjure up everything from breakfast to dinner or dessert. It contains plenty of e.g. protein, vitamin D and vitamin B12. The golden egg can be traced back to the farm based on the code found on the egg shell. You can do this on Kultamuna''s website www.kultamuna.fi .');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Kotimaista free-range large egg L15 1020 g', 111, '[112]', 12, 3.79, 'Large Kotimaista eggs are eggs from caged hens. They belong to the weight category L 63-73 g, i.e. large. They are packed in a cell of 15. Quality class: A Country of origin: Finland.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Kotimaista free-range egg M10 580g', 113, '[114]', 12, 1.99, 'Kotimaista free-range egg M10 580g');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Arla lactose-free yogurt', 115, '[116]', 13, 2.68, 'Velvety soft A&B natural yogurt flavored with captivating vanilla and a little fruit juice. Lactose-free & additive-free. Also contains calcium & vitamin D.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Arla lactose-free raspberry yogurt', 117, '[118]', 13, 2.69, 'Fresh raspberry yogurt contains A&B lactic acid bacteria and no white sugar. The recyclable jar is wood-based up to the surface and 100% fossil-free.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Arla lactose-free Pear yogurt', 119, '[120]', 13, 2.68, 'A cheerful pear gently brightens your day accompanied by velvety smooth natural yogurt and a splash of fruit juice. This recipe creates a gentle natural sweetness. Lactose free. Contains plenty of calcium, vitamin D and AB lactic acid bacteria.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Arla mango lactose-free yogurt', 121, '[122]', 13, 2.68, 'Velvety smooth A&B natural yogurt, tasty mango and a splash of fruit juice. This recipe creates a gentle natural sweetness. Lactose-free & additive-free. Also contains calcium & vitamin D.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio sparkling cream 2 dl', 123, '[124]', 14, 1.59, 'Valio sparkling cream is the nobility of creams. Whip into fluffy cream foam for desserts and pastries, or drizzle the creamy richness into, for example, soups, sauces and casseroles. Valio sparkling cream is available in packages of different sizes, also lactose-free and made from organic milk.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio sparkling cream 0.5 l', 125, '[126]', 14, 3.79, 'Valio sparkling cream is the nobility of creams. Whip into fluffy cream foam for desserts and pastries, or drizzle the creamy richness into, for example, soups, sauces and casseroles. Valio sparkling cream is available in packages of different sizes, also lactose-free and made from organic milk.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio Luomu™ butter 200 g', 127, '[128]', 15, 2.49, 'Valio Luomu™ butter is traditionally made by churning from pure Finnish organic cream, without additives. Only organic cream and salt have been used in its production. The fine and aromatic taste of organic butter is perfect for cooking and baking. It also crowns new potatoes and good bread. Valio Luomu™ is a sustainable choice for biodiversity. Check out other Valio Luomu™ products as well!');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio Polar® Light 10% e300 g slice', 129, '[130]', 32, 4.55, 'Valio Polar® Light 10% cheese has a lot of flavor, even though it contains only 10% fat. The fresh and aromatic taste of the finished slices goes well on bread. Valio Polar® Light 10% cheese has been awarded the Heart Label. It contains plenty of protein and calcium and is also a good choice as a snack to be nibbled on its own. Available in chunks and slices.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio Polar® Original 15% e300 g slice', 131, '[132]', 32, 4.55, 'Valio Polar® is a cheese whose taste is strong and mild at the same time. Valio Polar® Original 15% was one of Finland''s first light cheeses when it arrived on the market in 1991. The fresh and sweet nutty cheese tastes good as ready-made slices on top of bread and nibbled on its own. Available in chunks and slices.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio Polar® Original 15% e300 g slice', 133, '[134]', 32, 4.55, 'Valio Polar® 15% is a light cheese with flavor and character. A less salty version of the familiar favorite has also been developed, which still has a strong taste, even though there is only 0.6% salt in the cheese. A lower salt content can be achieved without compromising the taste, when part of the regular salt is replaced with Valio ValSa® milk salt, i.e. the natural minerals of milk. Valio Polar® 15% ValSa® cheese has been awarded the Heart Label and contains plenty of protein and calcium. Available in chunks and slices.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio Polar® Alder smoke e270 g slice', 135, '[136]', 32, 4.55, 'Valio Polar® Alder smoke is smoked with real alder smoke. This is how the cheese gets its soft, rich, smoky taste. Valio Polar® Alder smoke tastes great on bread and also brings variety to cooking, when you want the end result to be a soft, rich smokiness. Ready-made Valio Polar® Alder smoke slices are an easy way to bring a soft, rich smoky flavor to bread.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio Polar® Full e300 g slice', 137, '[138]', 32, 4.55, 'Valio Polar® Täyteläinen is a characteristic cheese in which the typical nutty nuances of Emmental are combined with the fullness of Gouda. It was the first cheese of the Polar® product family when it arrived on the market from the cooperative dairy of Valion Nurmense in 1979. The finished slices are especially good on bread. Available in chunks and slices.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio Polar® Luomu™ 15% e270 g slice', 139, '[140]', 32, 4.55, 'Valio Polar® Luomu™ 15% is a uniquely flavored light cheese made from Finnish organic milk. You can also notice a fruity sweetness in its fresh characterful taste. Valio Polar® Organic™ 15% tastes delicious on bread and nibbled on its own. It is also worth trying in cooking. The product has been awarded the Sydänmarkki, which states that it is a better choice in terms of salt and fat in its own product group. Valio Luomu™ is a sustainable choice for biodiversity. Check out other Valio Luomu™ products as well!');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('6 x Hartwall Novelle Mango-Orange', 141, '[142]', 16, 5.29, 'Novelle Fresh Mango-Orange mineral water 0.33 l');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('6 x Hartwall Novelle Raspberry-Lemon', 143, '[144]', 16, 5.29, 'Novelle Fresh is today''s natural and light thirst drink. The base of the drink is fresh mineral water, and the delicious raspberry-lemon flavor comes from a splash of full juice. The drink is stripped of all unnecessary; it has no added sugar or artificial sweeteners. The sweetness of the drink comes only from the juice and there is less than 0.5g/100ml of sugar in it.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('15-pack Coca-Cola', 145, '[146]', 17, 11.39, 'Coca-Cola is by far the most popular soft drink in Finland and throughout the world. It is a genuine and original cola drink, the recipe of which is still a secret, more than 130 years after the first glass. Coca-Cola''s inimitable cola taste and refreshment are based on the same traditional recipe all over the world. But one thing about the recipe is known for sure. Namely, that no preservatives or artificial flavors have been added to the drink.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('15-pack Coca-Cola Zero Sugar-free', 147, '[148]', 17, 10.79, 'Coca-Cola Zero® Sugar is a soft drink that tastes just as great as the original Coca-Cola, but without the sugar. The drink has zero calories, i.e. it contains energy of only 1.4 kJ / 0.3 kilocalories per deciliter. Young adults in particular have taken Coca-Cola Zero® Sugar as their soft drink option. The drink contains only natural flavors and no preservatives have been added. This way you can enjoy the original taste of Coca-Cola, without sugar.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio whole orange juice 1 l', 149, '[150]', 18, 1.89, 'Valio full orange juice is a classic on the breakfast table that the whole family can enjoy. The juice content of whole juices is always 100%, and only vitamin C has been added to whole orange juice. One dl of Valio full orange juice contains no less than 75% of the daily recommended intake of vitamin C. Try other Valio full juices too!');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio organic blueberry juice 1 l', 151, '[152]', 18, 2.35, 'Valio Hedelmätarha® organic blueberry juice tastes fresh and homey. The high-quality and delicious breakfast and snack drink contains blueberry juice from domestic organic blueberries. Valio Luomu™ is a sustainable choice for biodiversity. Check out other Valio Luomu™ products as well!');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Valio organic apple juice 1 l', 153, '[154]', 18, 2.35, 'Valio Hedelmätarha® organic apple juice is a gently refreshing start to the day! High-quality, cloudy "cloudy" full juice from organic apples. Valio Luomu™ is a sustainable choice for biodiversity. Check out other Valio Luomu™ products as well!');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Red Bull Sugarfree 0.25l', 155, '[156]', 19, 1.8, 'Red Bull energy drink is a functional product that gives you wings whenever you need them.

Inspired by the functional drinks of the Far East, Dietrich Mateschitz founded Red Bull in the mid-1980s. He not only invented a new product concept but also a completely new marketing concept when he launched the Red Bull energy drink in Austria on April 1, 1987. A new product category was born - energy drinks.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Red Bull Energy drink 0.355l', 157, '[158]', 19, 2.49, 'Red Bull gives you wings! The Red Bull energy drink refreshes the body and mind.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Monster Ultra White energy drink', 159, '[160]', 19, 2.05, 'Zero sugar, zero calories! Carbonated, energy drink without sugar, without calories - New, less sweet and lighter Monster Energy Ultra is zero calories, but full of Monster Energy. So, white is the new black. Unleash the Ultra Beast!');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Battery energy drink 0.33 L', 161, '[162]', 19, 2.59, 'Pure energy. Finland''s most popular energy drink since 1997. Battery Energy Drink is a vitaminized energy drink whose power is based on coffee and guarana extracts and taurine. Battery is a drink developed by Sinebrychoff, which is exported to more than 20 countries around the world.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Ginger Kombucha 350ml', 163, '[164]', 20, 3.75, 'Ginger kombucha, which tickles the taste buds, makes the joy splash and the energy returns even to a tired body. With plenty of cold-pressed ginger juice, Fresh Ginger kombucha is every ginger lover''s belly-pleasing trusted partner, where healthiness and deliciousness go hand in hand. Catch up and get excited yourself!

This kombucha is made in the artisan spirit, traditionally by fermentation, by The Good Guys kombucha maker from Pirkka, for whom high-quality ingredients and drinks that do good are a matter of the heart.

Exuding vitality, organic kombucha is raw and alive - the good bacteria it contains have not been boiled by pasteurs. So always keep The Good Guys kombucha in the fridge. At room temperature, the yeasts and bacteria of kombucha traditionally prepared by fermentation may become too wild, i.e. continue their fermentation process, as a result of which the kombucha may become too fizzy to drink.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Singapore Ice Coffee 235 ml', 165, '[166]', 20, 1.89, 'Paulig Singapore Ice Coffee is a cold coffee drink inspired by Singapore, which contains dark roasted coffee and milk. The robusta coffee contained in the coffee mix brings richness and strength to the coffee''s taste. The drink is also lactose-free and Fair Trade certified.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('New York Cold Brew Latte 235 ml', 169, '[170]', 20, 1.89, 'Paulig New York Cold Brew Latte is a soft milk coffee drink that gets its taste from Paulig Cold Brew cold-extracted coffee. The nuanced and naturally sweet taste of the coffee drink is created by extracting freshly ground coffee for 16 hours in cold water. The Paulig New York Cold Brew Latte cold drink is inspired by New York''s coffee culture and is especially suitable for real coffee lovers who are looking for convenient alternatives to hot coffee drinks.

Paulig New York Cold Brew Latte is lactose-free and Fair Trade certified. The products packed in an environmentally friendly cardboard can are easy to take with you and enjoy whenever you want.

• A nuanced milk coffee drink • Lactose-free • Enjoy cold • Keep unopened at room temperature • Fair trade certificate');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Parisien Café au Lait 235ml', 171, '[172]', 20, 1.89, 'Paulig Parisien Café au Lait is a neat and classic French coffee drink that contains dark roasted coffee and milk. The robusta contained in the dark roasted coffee brings depth to the taste of the coffee drink. Paulig Parisien Café au Lait brings the taste world of the traditional Parisian Café au lait to a fresh cold coffee drink. The cold drink is especially suitable for real coffee lovers who are looking for convenient alternatives to hot coffee drinks.

Paulig Parisien Café au Lait is lactose-free and Fair Trade certified. The products packed in an environmentally friendly cardboard can are easy to take with you and enjoy whenever you want.

• A neat milk coffee drink made from dark roasted coffee • Lactose-free • Enjoyed cold • Keeps unopened at room temperature • Fair trade certificate');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Starbucks 200 ml Doubleshot Espresso', 167, '[168]', 20, 2.3, 'Starbucks Doubleshot espresso milk coffee drink is a mixture of Starbucks Arabica coffee and fresh milk. Keeps at room temperature. Enjoy cold. Homogenized and sterilized. High caffeine content (47mg/100ml).');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Bundaberg 37.5cl Ginger Beer 0%', 173, '[174]', 33, 2.85, 'Non-alcoholic ginger beer. The full flavor is achieved by boiling the wort for three days. Locally produced ginger and sugar cane are used for production.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Fazer Toast Five grains 505g', 175, '[176]', 5, 2.15, 'Fazer Paahto Viisi graina is a delicious grainy bread, the taste of which is brought by the root of the dough, as well as the seeds and grains, which are abundant in the bread. As the name suggests, the bread contains five grains and it has received the Joutsenmark for the use of domestic grain. Fazer was the first to bring toast to Finland in 1966, after which the Fazer Paahto product family has expanded to include many delicious options. What all Fazer Paahto breads have in common is a delicious taste and offering perfect toasting pleasure; wonderfully soft interior combined with a delicious crispy crust. In addition, all Fazer Paahto breads are baked in Finland, at Fazer''s Vantaa Bakery.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Fairy Rapeseed oil 1 l', 177, '[178]', 9, 5.49, 'High-quality Keiju rapeseed oil is a trusted product in every kitchen, as it is suitable for both general cooking and frying as well as baking and deep-frying. Rapeseed oil contains plenty of omega-3 fatty acids and vitamin E.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Fazer Souffeli Puffi Snacks', 179, '[180]', 10, 3.05, 'Suffeli is a crispy classic that has been a delight since 1966. Underneath the chocolate coating of Suffeli Puffi Snack sweets, a crispy corn puff is revealed. Now it''s easy to enjoy Suffeli Puffi Snack sweets in a vertical bag suitable for snacking. Best of all, all Fazer''s delicious chocolates are made from 100% responsibly produced cocoa. Treat yourself to a bag or share with friends!');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Karl Fazer raspberry yogurt chocolate', 181, '[182]', 10, 4.85, 'In Karl Fazer Raspberry Yoghurt candies, soft milk chocolate wraps a fresh raspberry yogurt filling, which brings summer to your tongue. Finland''s most loved chocolate, whose unique rich taste has been guaranteed by the best ingredients since 1922. All Fazer''s delicious chocolates are made from 100% responsibly produced cocoa. A box of chocolates is a wonderful gift for festive occasions!');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Karl Fazer milk chocolate', 183, '[184]', 10, 5.95, 'Finland''s most loved chocolate, whose unique rich taste has been guaranteed by the best ingredients since 1922. In addition to the taste of this milk chocolate made from real milk, you will also recognize the blue wrapper, whose golden Karl Fazer signature acts as a guarantee of quality. Best of all, all Fazer''s delicious chocolates are made from 100% responsibly produced cocoa. Give a chocolate box suitable for the best moments as a gift or enjoy it with friends.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Fazer Geisha hazelnut nougat chocolate', 185, '[186]', 10, 5.95, 'Delicious Geisha candies, where soft milk chocolate hides a crunchy hazelnut nougat filling. Best of all, all Fazer''s delicious chocolates are made from 100% responsibly produced cocoa. Be inspired by peace and offer friends a moment of time together. A beautiful box of chocolates is also a gift that will be remembered.');
INSERT INTO wmall.products (name, image_id, image_ids, category_id, price, detail) VALUES ('Leader Performance WHEY protein powder 500g', 187, '[188]', 34, 14.45, 'Leader Performance Whey Chocolate is a chocolate-flavored whey protein concentrate made from high-quality whey. Whey protein is a fast-absorbing, milk-derived protein with an excellent amino acid profile. It contains a lot of branched-chain amino acids (BCAA), which makes whey a popular protein supplement for building and maintaining muscle mass. Enjoy a highly soluble protein supplement as a snack, after training or to increase the protein content of a meal.');

